import 'bootstrap/dist/css/bootstrap.min.css';

import React from 'react';
import Container from 'react-bootstrap/Container'
import Navbar from 'react-bootstrap/Navbar'

function App() {
  return (
    <div className="App">
      <Navbar expand="sm">
        <Container>
          <Navbar.Brand href="#">DRINK THE DIRT</Navbar.Brand>
        </Container>
      </Navbar>
    </div>
  );
}

export default App;
